(13, 2, 'One Piece Spoil 1,057', '<p>-ชื่อตอน “บทสรุป”<br>-โมโมโนะสุเกะ,คินเอม่อน และยามาโตะ!! มากล่าวลาลูฟี่และพรรคพวกทุกคน!!!<br>-ยามาโตะเลือกที่จะยังไม่ไปกับลูฟี่ แต่เธอจะขออยู่สำรวจวะโนะคุนิต่อไปก่อนและเมื่อถึงเวลาแล้วเธอก็จะออกทะเลแน่นอน!!!<br>-ลูฟี่มอบธงโจรสลัดของเขาให้กับโมโมโนะสุเกะ!!!<br>-ลูฟี่บอกกับ โมโมโนะสุเกะ,คินเอม่อน และ ยามาโตะ ว่าเมื่อพวกนายตัดสินใจได้แล้วว่าจะออกทะเลไว้ฉันจะมารับนะ!!<br>-ลูฟี่,คิด,ลอว์ และพันธมิตรโจรสลัดแล่นเรือออกจากวะโนะคุนิ!!!<br>-ในช่วงท้ายของตอน!! โมโมโนะสุเกะกำลังคิดว่าจะปักธงกลุ่มหมวกฟางเอาไว้ที่ตรงไหนดี?!!<br>-ปิดม่านองก์ที่ 3&nbsp;<br>-ภาควะโนะคุนิ : อวสาน</p>', 3, '2022-08-14 06:39:02'),
(14, 2, 'วันของเป็ดไม่ใช่ห่าน | LIVE - Goose Goose Duck! #21', '<figure class=\"media\"><div data-oembed-url=\"https://www.youtube.com/watch?v=iIFerl19sr4&amp;ab_channel=HEARTROCKER\"><div style=\"position: relative; padding-bottom: 100%; height: 0; padding-bottom: 56.2493%;\"><iframe src=\"https://www.youtube.com/embed/iIFerl19sr4\" style=\"position: absolute; width: 100%; height: 100%; top: 0; left: 0;\" frameborder=\"0\" allow=\"autoplay; encrypted-media\" allowfullscreen=\"\"></iframe></div></div></figure>', 5, '2022-08-15 17:51:18'),
(15, 2, '[Ten Sura] [Spoil] เกิดใหม่ทั้งทีก็เป็นสไลม์ไปซะแล้ว LN เล่ม 16', '<p>[Ten Sura] เกิดใหม่ทั้งทีก็เป็นสไลม์ไปซะแล้ว LN เล่ม 16<br>❌❌❌มีการเปิดเผยเนื้อหาสำคัญ❌❌❌<br>.<br>.</p><hr><p>ตอนนี้นิยายเล่ม 16 ฉบับภาษาไทยโดย LP วางขายแล้ว<br>เราจึงขอลบเนื้อหาส่วนนึงออกนะคะ ตามลิขสิทธิ์ค่ะ<br>แต่ยังจะทิ้งสปอยล์แบบคร่าว ๆ เอาไว้ค่ะ<br>ขอบคุณที่แวะมาพูดคุยกันนะคะ<br>แล้วเดี๋ยวจะแก้ชื่อต่าง ๆ ให้ตรงกับทาง LP เพื่อลดความสับสนด้วยอีกทีค่ะ<br>หัวใจ</p><hr><p><br>ก่อนอื่น ขอเราแปะรูปแผนผังคร่าว ๆ ไว้ก่อนนะคะ<br>เนื่องจากว่าเราจะสปอยล์แบบสรุปสั้น ๆ ง่าย ๆ<br>อาจจะทำให้งง ว่าอะไรเป็นอะไรกันแน่<br>แผนผังนี้ จะช่วยให้เข้าใจง่ายขึ้นนิดนึง (หวังว่านะคะ)</p><p>เราจะสปอยล์บทนำละเอียดนิดนึง<br>เพราะมีประเด็นและเผ่าพันธุ์ใหม่ ๆ หลายเผ่า<br>เล่มต่อจากนี้คงจะอ้างอิงจากตรงนี้เยอะขึ้นด้วย<br>ส่วนตอนต่อ ๆ ไป ขอไม่ลงละเอียดยิบนะคะ<br>อ่านแล้วมันมาก จะได้ไม่เสียอรรถรสตอนอ่านเองค่ะ</p><p>ส่วนเราเอง ถ้าไม่ทำผังความสัมพันธ์ระหว่างเหล่าเซราฟิม<br>และเผ่าผู้รุกรานเอาไว้ ก็มีอ๊อง ๆ เหมือนกันค่ะ<br>ว่าเอ๊ะ เมื่อกี้ยังไงแล้วนะ ถถถ</p><p>ยังไงคิดว่าเล่มต่อไปคงมีความสัมพันธ์พวกนี้เยอะขึ้น<br>เลยคิดว่าทำเอาไว้ล่วงหน้าเลยดีกว่าค่ะ<br>พอวางรูปเสร็จ แล้วจะมาสปอยล์อีกทีนะคะ<br>ข้อมูลของเซราฟิมค่อนข้างซับซ้อน เราเลยพยายามย่อยให้ละเอียด<br>จะได้เอาไว้อ้างอิงเล่มต่อ ๆ ไปด้วยค่ะ<br>เม่าบาดเจ็บ</p><p>&nbsp;</p>', 6, '2022-08-15 17:52:35'),
(16, 2, ' [CR] รีวิว THE SANDMAN เป็น 1 ใน ซีรีส์ที่ดีที่สุดจาก NETFLIX คุณภาพดี ลงตัวมาก !', '<figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh7685wVsF7cMe6l-o.jpg\"></figure><p><br>ก่อนอื่นต้องบอกเลยว่า THE SANDMAN นั้นเป็นโปรเจคที่ไม่ค่อยมีอนาคตเท่าไรก่อนหน้านี้เพราะว่ามีการปรับเปลี่ยน โยกย้ายกันบ่อยซึ่งตอนแรกจะสร้างเป็นหนังโรง แต่สุดท้ายมาตกกันที่ NETFLIX นั้นเองครับ และ เป็น คอมมิคที่หลายๆสื่อ ยกให้เป็นอันดับต้นๆหรือคอมมิคที่ดีที่สุดตลอดกาลเลย ในไทยหลายๆคนอาจจะไม่รู้จักเท่าไรครับแต่บอกเลยว่า คุณภาพชื่อชั้นไม่ธรรมดา มาจากเครือ DC ที่เราคุ้นเคยแต่จะในแนวธีมที่ดาร์กไปอีก เรียกกันว่า DC VERTIGO นั้นเอง ซึ่งหลายๆคนอาจจะรู้จักตัวละคร เช่น CONSTANTINE หรือ LUCIFER นั้นเองครับและพวกนี้ก็มาจากหัว VERTIGO นี้เช่นกัน และในเรื่องนี้ก็มีตัวละครพวกนี้มาด้วยและบอกเลยว่าไม่ธรรมดาครับสำหรับ THE SANDMAN ซึ่ง ในเรื่องนี้จะเล่าไปในกลุ่ม ENDLESS หรือ เทพขั้นสุดของจักรวาล ทั้ง Dream, Death ,Destiny, Desire, Dellrium, Destruction, Despair ที่จะคอยดูแล ตอบสนองต่อความต้องการของมนุษย์ ดูแลในแต่ละหน้าที่ของตัวเอง ซึ่งในเรื่องนี้จะเน้นไปที่ DREAM หรือ ความฝันที่คอยดูแล สร้างความฝันของมนุษย์ เป็น ซีรีส์ที่เล่าเกี่ยวกับ เวทมนต์ ความฝัน เทพเจ้า และ เล่นประเด็นกับความคิด ใจ มนุษย์ ได้แบบลึกและลงตัวมาก</p><figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh72fsjwFwFS6lGlu5-o.jpg\"></figure><p>เนื้อเรื่องนั้นต้องบอกว่าจากคอมมิคบอกเลยว่าทำได้ดีอยู่แล้ว และเรื่องนี้ดัดแปลงมาได้เข้าใจง่ายแต่แฝงอะไรได้เยอะมากจริงๆครับ รวมถึงในการเล่าในแต่ละช่วงแต่ละ EP ทำได้ดีมาก 1-5 เน้นความแฟนตาซี สายเวทย์น่าจะถูกใจแน่ๆครับ แอคชั่นพอสนุก แต่ในส่วนหลังๆ 6-10 จะเน้นไปที่เจาะลึกประเด็นแต่ละส่วน ความสัมพันธ์ ความคิดของมนุษย์ เจตนาต่างๆที่อาจจะไม่ได้หวือหวาเท่าช่วงแรกแต่ดีมากจริงๆรวมถึงเมื่อตอนหลังๆสามารถปิดท้ายได้อย่างลงตัว คลายปมก่อนหน้าทั้งหมดและสื่อออกมาได้ดีไม่ต้องกลัวว่าไม่ติดตามมาก่อนจะไม่เข้าใจเพราะช่วงแรกของหนังสามารถเล่าและแปลงตามความเข้าใจได้ดีมาก และส่วนตัวถ้าเครื่องติดแล้วจะไม่น่าเบื่อและสามารถเข้าใจได้เลยว่าในตอนจบมันลงตัวไปหมดทั้ง เรื่องที่ปูมา และ ในอนาคต รวมถึงการเล่าเรื่องในแต่ละส่วนมีแนวหนังแตกต่างกันแต่ละ EP เจาะประเด็นคนละแบบแต่ก็สามารถเข้าใจได้ไม่ยาก แต่อาจจะลึกไปสำหรับบางท่านได้ในหลายๆช่วง เช่น EP 6-8 อาจจะมีหลุดได้ถ้าไม่ได้ตั้งใจหรือแบบข้ามอะไรครับแต่เรื่องราวผมว่ายังคงทำได้แน่นอยู่นะแต่จะเล่าเรียบๆ</p><figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh7496nPjAeBiN9n-o.png\"></figure><p>นักแสดงเองนั้น เป็นส่วนนึงที่ทำให้ซีรีส์เรื่องนี้ลงตัวมีหลายๆฉากที่มีข้อจำกัดสถานที่ นักแสดงสามารถเล่าได้ทั้งหมดโดยที่ไม่ได้น่าเบื่อและแสดงออกมาได้ทั้งอารมณ์ ความอึดอัดของคนดู และ ลุ้นว่าจะเป็นยังไงต่อยิ่ง EP5 อันนี้คือชัดเจนครับที่เราจะได้ David Thewlis มาโชว์แบบเต็มๆด้วยอีกทั้ง นักแสดงนำ Tom Sturridge , Niamh Walsh , Boyd Holbrook , และอีกมากมายซึ่งมีหลายๆตัวละครได้เปลี่ยนจากตัวละครที่เราคุ้นตากันเช่น LUCIFER ก็เปลี่ยนเป็น ผญ ที่รับบทโดย Gwendoline Christie นั้นเองครับ ซึ่งก็จริงๆมันสามารถปรับเปลี่ยนได้ด้วยทั้งตัวละครและบทบาทในตัวมันเอง แต่ก็บอกเลยว่ามีฉากที่เราจะได้เห็นการต่อสู้ของ LUCIFER และ DREAM แบบแปลกใหม่มากจริงๆ เป็นการต่อสู้ระดับเทพเจ้าสูงสุดซึ่งไม่ต้องใช้กำลังแต่สื่อออกมาได้แปลกใหม่และคล้ายกับคอมมิค ด้วยเช่นกันครับไม่คิดว่าจะทำได้ดีแบบนี้เลยตอนแรกที่ดู และ นักแสดงทั้งหมดสื่อสารด้วยสายตาบ่อยและเข้าถึงได้เลยว่าเป็นยังไงส่วนนี้ต้องขอยกความดีให้เลยครับ แต่อาจจะมีตัวละครบางตัวที่ไม่มีตาก็ยังคงแสดงได้ดีนะทั้งท่าทาง และเอกลักษณ์ของตัวละครมันเองเนี่ยแหละทำให้รู้สึกว่าแต่ละเทพเจ้า และ แต่ละคนนั้นไปในแนวตัวเองดี</p><figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh7ygttfIpxjEVCZ-o.jpg\"></figure><p>งานภาพเองสวยงามและมีความแปลกตา แต่ขอชมว่าโทนหนังทำได้สวยมาก การทำสีเล่นแสงเงา และการสื่อภาพแต่ละฉากแต่ละช่วง ซึ่งบางครั้งเราจะเห็นการใช้งานเลนส์มุมกว้างที่ขอบข้างๆจะเบี้ยวหรือตัวคนผอมสูงเพราะอาจจะด้วยความที่ต้องการสื่อว่าอยู่ในความฝันต่างๆ มุมภาพจะแปลกตากว่าที่เราเคยดูหนังมาเยอะพอสมควรแต่ผมชอบนะเพราะส่วนตัวเป็นคนเสพงานภาพอยู่แล้วและ ซีรีส์เรื่องนี้งานภาพขอขมว่าสวยและดี อารมณ์ภาพได้ ส่วนเพลงประกอบเองนั้นสามารถบิ้วอารมณ์แต่ละช่วงได้ดีเป็นส่วนสำคัญที่จะให้เราลุ้นหรือมีอารมณ์ร่วมไป ซึ่งไม่ได้มีเพลงอะไรติดหูเท่าไร แต่หลายๆครั้งการเลือกเพลงพื้นหลังช่วยเสริมอารมณ์ได้ดีนะงานภาพเสียงประกอบเด่นพอสมควรสำหรับหนังแนวนี้ที่อาจจะไม่ได้มีช่วงให้ใส่เพลงติดหูอะไรครับ เพราะแนว ดราม่ามืดมนอาจจะเล่นอะไรได้ยากกว่าทั่วไปเยอะ</p><figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh7231nA5n0kp2225-o.jpg\"></figure><p>ภาพรวมนั้นกล้าพูดว่าเป็น ซีรีส์ที่ดีที่สุดของ NETFLIX ที่เคยดูมาก็ไม่เวอร์เกินไป ทั้งคุณภาพงานภาพ ความลงตัวของบท เนื้อหา และ การเล่าเรื่องอีกทั้ง การดึงนิยายระดับตำนานของ Neil Gaiman &nbsp;มาได้อย่างลงตัว เพราะครั้งนี้เค้ามาช่วยดูแลกับตัวเองจึงไม่แปลกใจเลยจริงๆครับ กับความมืดหม่นของหนังที่แนว DC จริงๆเข้ามาเสริมกับความแฟนตาซีของสายเวทย์ เทพเจ้า บอกเลยว่ามันลงตัว ดูง่าย และไม่ได้เครียดแบบที่หลายๆคนคิดแน่นอน อยากให้เปิดใจลองดู เป็นซีรีส์คุณภาพที่หลังๆไม่ค่อยได้เจอกันเท่าไรแล้วในแนว นิยาย เทพเจ้าแบบนี้และเรื่องนี้ติดอันดับต้นๆไปแล้วในตอนนี้ และ ภาคต่อมีมาแน่นอนครับปูมาเยอะแบบนี้และยังอีกยาวบอกเลยสำหรับเรื่องนี้ ส่วนตัวชอบ EP5 ที่เป็นจุดเดือดในคอมมิคด้วย และ เป็นการแสดงพลังของนักแสดง และ คนเขียนบทจริงๆทั้ง EP อยู่แต่ในร้าน DINER แต่สามารถเล่าอะไรได้เยอะมากกก และไม่น่าเบื่อขอยอมรับเลยทีเดียวว่าสุด และ กล้าที่จะทำออกมา</p><figure class=\"image\"><img src=\"https://f.ptcdn.info/080/078/000/rg8eh725d36TbBIQP6ix-o.png\"></figure><p>&nbsp;</p>', 2, '2022-08-15 17:54:47'),
(17, 2, 'ตามหาอนิเมะ', '<p>ตามหาอนิเมะที่หนึ่งในตัวดำเนินเรื่องเป็นผู้หญิงปลอมตัวเป็นผู้ชายแล้วต้องไปอยู่ในกลุ่มที่ต้องไปต่อสู้กับฝ่ายตัวร้ายแล้วต้องเดินทางไปดาวต่างๆเพื่อตามหาหุ่นยนต์โบราณเพื่อที่จะต่อสู้กับฝ่ายตัวร้าย</p>', 1, '2022-08-15 17:55:45');

